import React from 'react'
import {IIngredient} from '../../_interfaces/IMenu'
import {Grid, makeStyles} from '@material-ui/core'
import MenuInputComponent from './MenueInputComponent'

const styles = makeStyles({
    ingrdient_root:{
        display: 'flex',
        flexDirection: 'row',
        maxWidth: '82vw'
    },
    item:{
    }
})

interface IProps{
    ingredient: IIngredient | null
    isReadOnly: boolean
}


const IngrdientListtem: React.FC<IProps> = (props) => {

    const {ingredient, isReadOnly} = props
    const useStyle = styles()

    return(
       <Grid 
            container
            className={useStyle.ingrdient_root}>
                <Grid
                    className={useStyle.item}
                    xs={4}
                    item>
                    <MenuInputComponent
                        label='Amount'
                        fullWidth={false}
                        value={ingredient?.amount?? ''}
                        isReadonly= {isReadOnly}/>
                </Grid>
                <Grid
                    className={useStyle.item}
                    xs={4}
                    item>
                     <MenuInputComponent
                        label='Name'
                        fullWidth={false}
                        value={ingredient?.name?? ''}
                        isReadonly= {isReadOnly}/>
                </Grid>
                <Grid 
                    className={useStyle.item}
                    xs={4}
                    item>
                     <MenuInputComponent
                        label='Name'
                        fullWidth={false}
                        value={ingredient?.name?? ''}
                        isReadonly= {isReadOnly}/>
                </Grid>
        </Grid>
    )
}

export default IngrdientListtem
